function parseXEC(t,p){e=false;t.split(".").length===1?e=true:t.split(".").slice(1).forEach((x)=>{if(isNaN(parseInt(x)))e=true});return e?encodeXEC(t,p):decodeXEC(t)}function encodeXEC(t,p){o="";p=p.split("").map((x)=>x.charCodeAt(0)).reduce((a,x)=>a+x,0);t.split("").map((x)=>x.charCodeAt(0)).forEach((x)=>{x+=p;a=Math.floor(Math.random()*x/3*2)+1,b=Math.floor(Math.random()*(x-a))+1,c=x-a-b;o+=`.${a}.${b}.${c}`});return o}function decodeXEC(t){a=t.split(".").slice(1).map((x)=>parseInt(x)),b=[],c=0,d={},e=0;if(a.length%3!==0)return;for(i=0;i<a.length;i+=3)b.push(a[i]+a[i+1]+a[i+2]);b.forEach((x)=>{d[x]=(d[x]||0)+1;if(d[x]>e)e=d[x],c=x});return String.fromCharCode(...b.map((x)=>x-c+32))}